import styles from './Header.module.css';
import alogo from '../../data/aplogo.png';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <div  className={styles.header}>
        <img src={alogo} alt="logo" className={styles.logo} />
    </div>
    );
}

export default Header;
